import React from 'react'
import Card from './Card'
import "./Main.css"

function Main(props) {

    let productData = props.proData
    let navigate = useNavigate()
    console.log(productData, "Data came from Home")

    // function openProduct(prod) {
    //     navigate("/preview", { state: prod })
    // console.log(prod, "data for prod")
    // }

    return (
        // <div className="mainBodyGrid">

            <div className="mainGridBody">
                {productData.map((prod) => (
                    <>
                        <div className="clickProduct product" >

                            <Card
                                imgSrc={prod.img}
                                title={prod.brand}
                                price={prod.face}
                                desc={prod.desc}
                                rate={prod.rate}
                                brand={prod.brand}
                                market={prod.market}
                            />
                        </div >
                    </>
                ))
                }

            </div>
        // </div>
    )
}

export default Main
